<script>
    document.addEventListener('DOMContentLoaded', function() {
        const districtSelect = document.getElementById('district-select');
        const svgMap = document.getElementById('map');
        const paths = svgMap.querySelectorAll('path');

        // Highlight the selected district
        districtSelect.addEventListener('change', function() {
            // Remove highlight from all paths
            paths.forEach(path => {
                path.classList.remove('highlight');
            });

            // Highlight the selected path if a district is chosen
            if (this.value) {
                const selectedPath = document.getElementById(this.value);
                if (selectedPath) {
                    selectedPath.classList.add('highlight');
                }
            }
        });

        // Optional: Add hover effect
        paths.forEach(path => {
            path.addEventListener('mouseenter', function() {
                this.classList.add('highlight');
            });

            path.addEventListener('mouseleave', function() {
                if (this.id !== districtSelect.value) {
                    this.classList.remove('highlight');
                }
            });

            // Click to select
            path.addEventListener('click', function() {
                districtSelect.value = this.id;
                paths.forEach(p => p.classList.remove('highlight'));
                this.classList.add('highlight');
            });
        });
    });
        document.getElementById('district-select').addEventListener('change', function() {
            const selectedDistrict = this.value;
            // Reset all districts to their original colors
            document.querySelectorAll('#map path').forEach(path => {
                path.classList.remove('highlight');
            });
            
            if (selectedDistrict) {
                // Highlight the selected district
                document.getElementById(selectedDistrict).classList.add('highlight');
            }
        });
</script>
